animal.description:
Hi, I'm Doug, the gentle giant. I came to Almost Home as a stray but my foster mom can tell that I can from a well-loved home. I'm very polite and am well mannered too. I know a variety of basic commands, walk great on a leash, and am house-broken as well as crate trained. Although, my foster mom doesn't crate me because I'm so well behaved.

An experienced alpha owner with an all-adult household is preferred. Unfortunately, I cannot go to a home with children because I do have food aggression issues and kids are a bit too unpredictable for me. My foster parents are working on this with me, and my new parents will have to continue the work.

I get along well with other dogs, like to chew bones (just don't put your hands near my mouth while I'm chewing) and absolutely love being outdoors. I'm very cuddly, love being pet and will become your new shadow.

I'm a really good boy (my foster mom says so) and would love to be your new best friend! 



Email: dogs@almosthomefoundation.org

Almost Home Foundation's adoption requirements:
(1) Be at least 21 years of age;
(2) Have the consent of all adults living in the household;
(3) Have approval from the residence owner;
(4) Have valid ID with current address;
(5) Be approved by Almost Home Foundation as a suitable adoptive home; and
(6) Live in the suburbs surrounding Schaumburg (Illinois Residents only)
*** Please note that Almost Home Foundation accepts only cash or checks for adoption fees; we do not accept debit or credit cards. ***
